<section>
<canvas id="canvas"></canvas>
<script type="module">
  const canvas = document.getElementById("canvas");
  const img = document.getElementById('webcam');
  const ctx = canvas.getContext('2d');
  canvas.width = img.width;
  canvas.height = img.height;
  ctx.drawImage(img, 0, 0, img.width, img.height);
  ctx.beginPath();
  ctx.moveTo(img.width/2, 0);
  ctx.lineTo(img.width/2, img.height);
  ctx.stroke();
  import vision from "https://cdn.jsdelivr.net/npm/@mediapipe/tasks-vision@0.10.0";
  const { FaceLandmarker, FilesetResolver, DrawingUtils } = vision;
  let faceLandmarker;
  let runningMode = "IMAGE";
  const filesetResolver = await FilesetResolver.forVisionTasks(
    "https://cdn.jsdelivr.net/npm/@mediapipe/tasks-vision@0.10.0/wasm"
  );
  function calculateCentroid(landmarks) {
     const sum = landmarks.reduce((acc, landmark) => {
        acc[0] = landmark.x+acc[0];
        acc[1] = landmark.y+acc[1];
        acc[2] = landmark.z+acc[2];
        return acc;
     }, [0,0,0]);
     return sum.map(coord => coord / landmarks.length);
  }
  faceLandmarker = await FaceLandmarker.createFromOptions(filesetResolver, {
    baseOptions: {
      modelAssetPath: 
      "https://storage.googleapis.com/mediapipe-models/face_landmarker/face_landmarker/float16/1/face_landmarker.task",
      delegate: "GPU"
    },
    outputFaceBlendshapes: true,
    runningMode,
    numFaces: 1
  });
  const centroid = calculateCentroid(faceLandmarker.detect(img).faceLandmarks[0]);
  const vcentroid = [centroid[0]*img.width,centroid[1]*img.height];
  ctx.beginPath();
  ctx.arc(vcentroid[0], vcentroid[1], 10, 0, 2*Math.PI, true);
  ctx.fill();
  const visionLine = 0.5;
  const distance = visionLine-centroid[0];
  const relativeDistance = Math.abs(distance)/centroid[0];
  const threshold = 0.7;
  const action = relativeDistance >= threshold ? "NONE" : distance > 0 ? "left" : "right";
  alert(action);
</script>
</section>
`

