import {
    FaceLandmarker,
    FilesetResolver,
    DrawingUtils
} from "https://cdn.jsdelivr.net/npm/@mediapipe/tasks-vision@0.10.0";

const filesetResolver = await FilesetResolver.forVisionTasks(
    "https://cdn.jsdelivr.net/npm/@mediapipe/tasks-vision@0.10.0/wasm"
);

/* 
   TODO: I think this function introduce a high overhead, so it should be migrated to WASM C.
*/
function calculateCentroid(landmarks) {
    const sum = landmarks.reduce((acc, landmark) => {
        acc[0] = landmark.x + acc[0];
        acc[1] = landmark.y + acc[1];
        acc[2] = landmark.z + acc[2];
        return acc;
    }, [0, 0, 0]);
    return sum.map(coord => coord / landmarks.length);
}

const faceLandmarker = await FaceLandmarker.createFromOptions(filesetResolver, {
    baseOptions: {
        modelAssetPath: "https://storage.googleapis.com/mediapipe-models/face_landmarker/face_landmarker/float16/1/face_landmarker.task",
        delegate: "GPU"
    },
    outputFaceBlendshapes: false,
    runningMode: "IMAGE",
    numFaces: 1
});


const visionLine = 0.5;
const threshold = 0.2;

captureStream().pipe(
  throttleTime(1000),
  map(({message: img}) => {
    const faceLandmarks = faceLandmarker.detect(img).faceLandmarks;
    if (faceLandmarks.length === 0)
        return "c";
    const [x,y,z] = calculateCentroid(faceLandmarks[0]);
    const distance = visionLine-x;
    const relativeDistance = Math.abs(distance)/x;
    return relativeDistance <= threshold ? "NONE" : distance > 0 ? "l" : "r";
  }),
  rewrite()
)

