        acc[0] = landmark.x + acc[0];
        acc[1] = landmark.y + acc[1];
        acc[2] = landmark.z + acc[2];
        return acc;
    }, [0, 0, 0]);
    return sum.map(coord => coord / landmarks.length);
}

const faceLandmarker = await FaceLandmarker.createFromOptions(filesetResolver, {
    baseOptions: {
        modelAssetPath: "https://storage.googleapis.com/mediapipe-models/face_landmarker/face_landmarker/float16/1/face_landmarker.task",
        delegate: "GPU"
    },
    outputFaceBlendshapes: false,
    runningMode: "IMAGE",
    numFaces: 1
});


const visionLine = 0.5;
const threshold = 0.4;


connect("MQTT", {
  ...environment.mqtt,
  topic: "eva/camera/image"
}).pipe(
  filter(x => x.message),
  throttleTime(200),
  base64ToBlob(),
  blobToImage,
  map(({message: img, connection}) => {
    const faceLandmarks = faceLandmarker.detect(img).faceLandmarks;
    if (faceLandmarks.length === 0) {
      connection.send({topic: "eva/neck/animation", message: "c"});
      return {message: null, connection};
    }
    const [x,y,z] = calculateCentroid(faceLandmarks[0]);
    const distance = visionLine-x;
    const relativeDistance = Math.abs(distance)/x;
    if (relativeDistance <= threshold)
      return {message: null, connection};
    connection.send({topic: "eva/neck/animation", message:  distance > 0 ? "r" : "l"});
    return {message: math.distance([x,y,z], [0,0,0]), connection};
  }),
  filter(x => x.message && x.message <= 1.2),
  throttleTime(5000),
  tap(({connection}) => {
    connection.send({topic: "hermes/tts/say", message: serialize({text: "Hola ¿Cómo estas? ¿Qué puedo hacer por ti hoy?"})})
    await new Promise(resolve => setTimeout(1000));
    connection.send({
                topic: "hermes/hotword/default/detected",
                message: serialize({
                    "siteId": "default",
                    "model_id": "default",
                    "model_version": "",
                    "model_type": "personal",
                    "current_sensitivity": 1.0
                })
          })
  })
)

